import React from 'react';
import Menu from './Menu';

const Header = () => {
return ( 
    <header className="nav">
            <div className="nav_logo">
                <a href="#!" className="logo">Dereck</a>
            </div>
                <Menu/>
                <div className="nav_icons">
                    <ion-icon name="grid-outline"></ion-icon>
                </div>
        </header>
    );
}

export default Header;
